// src/components/Content/RegionInfo/index.js

import React from 'react';
import { useSelector } from 'react-redux';
import { Card } from 'antd';

const RegionInfo = () => {
  const selectedRegion = useSelector((state) => state.selectedRegion);

  // Replace this with actual region information based on the selectedRegion
  const regionInfo = {
    currency: 'USD',
    speedUnit: 'kmph',
    distanceUnit: 'kilometers',
    volumeUnit: 'liters',
    timezone: 'GMT+0',
  };

  return (
    <Card>
      <p>Selected Region: {selectedRegion}</p> {/* Use the variable if needed */}
      <p>Currency Symbol: {regionInfo.currency}</p>
      <p>Speed Unit: {regionInfo.speedUnit}</p>
      <p>Distance Unit: {regionInfo.distanceUnit}</p>
      <p>Volume Unit: {regionInfo.volumeUnit}</p>
      <p>Timezone(s): {regionInfo.timezone}</p>
    </Card>
  );
};

export default RegionInfo;
